import React from "react";
const App=()=>{
    return (
    
    <div className="container">
       <div className="valid-keys">
           <span className="matched" style={{backgroundColor:'yellow'}}>emer</span>
           <span className="remainder">son</span>
       </div>
       <div className="typed-keys"></div> 
       <div className="completed-words-keys">
           <ol>
               <li></li>
               
           </ol>
       </div>
    </div>
    )
}
export default App;
